import React, { Component } from "react";
import Title from "./Title";
import Description from "./Description";
import GroupTransformation from "./GroupTransformation";
import Preview from "./Preview";
import Collapsible from "react-collapsible";
import { Link } from "react-router-dom";

function Example(props) {
  debugger;
 //  var z = "neha";
  if(props.location.aboutProps.name.backButton !== undefined){
    var x = props.location.aboutProps.name.backButton.location.aboutProps.name.x;
    var tableData = x.name.send.posts;
    var checkData = x.name.send.checkboxMark;
 
  }
  else{
    debugger;
    var x = props.location.aboutProps;
    var tableData = x.name.send.posts;
    var checkData = x.name.send.checkboxMark;
    debugger;
    if(x.name.send.cardsValue!==undefined){
    var statusChecked =x.name.send.cardsValue.location.aboutProps.storage.customerColumnList.location.aboutProps.name.logTable.random.location.aboutProps.load.z;
    console.log(statusChecked);
    }
  }
debugger;
  for (var i = 0; i < checkData.length; i++) {
    if (checkData[i].dbType == "mongodb") {
      let arraySort = [
        tableData[0].Customer_ID,
        tableData[0].Business_Date,
        tableData[0].Card_Type,
        tableData[0].Spend_Amount,
        tableData[0].Paid_Amount
      ];
      checkData[i].columnValue = arraySort[i];
    } if (checkData[i].dbType == "mariadb") {
      let arraySort = [
        tableData[0].Customer_ID,
        tableData[0].DOB,
        tableData[0].Marital_Status,
        tableData[0].Postal_Code,
        tableData[0].Self_Employed
      ];
      checkData[i].columnValue = arraySort[i];
    }
    //single array
  
  }


    debugger;
    var arr=[];
   for(var i=0; i < checkData.length; i++){
   // var arr=[];
     if(checkData[i].isChecked){
      
      arr.push({
      id: checkData[i].id,
      description: checkData[i].description,
      usedIn: checkData[i].usedIn,
      isChecked: checkData[i].isChecked,
      dbType: checkData[i].dbType,
      columnValue: checkData[i].columnValue,
    })
  }
    var loadStorage = arr;
   }
   var z = loadStorage;
   console.log(z);
debugger;
   var dataMap = [...z];
   console.log(dataMap);
   if(statusChecked!== undefined){
     var dataMap = [...z,...statusChecked]
     console.log(dataMap);
   }

  return (
    <div style={{ backgroundColor: "white" }}>
      <Title title={"FULCRUM"} />
      <div class="transPush">
        <i
          class="fa fa-angle-double-left"
          style={{ fontSize: "18px", paddingRight: "5px" }}
        ></i>
        {/* <Link
          className="push"
          to="/DailyTransaction"
          style={{ color: "white" }}
        >
          BACK
        </Link> */}
 <Link
            className="push"
            style={{ color: "white" }}
            to={{
              pathname: "/DailyTransaction",
              aboutProps: {
                load: {z}
              }
            }}
          >
            BACK
          </Link>          

      </div>
      <div class="container">
        <div class="card">
          <div class="card-body">
            <div>
              <h4 class="card-title" style={{ fontSize: "18px" }}>
                My WorkBench
              </h4>
            </div>
            <div>
              <table class="table table table-bordered table-striped">
                <thead class="tableTransform">
                  <tr>
                    <th>Source</th>
                    <th>Feature</th>
                    <th>Description</th>
                    <th>Sample Values</th>
                    <th>Apply f(x)</th>
                  </tr>
                </thead>
                <tbody>
                  {dataMap.map(check => (
                    <tr>
                      <td>{check.isChecked && check.dbType}</td>
                      <td>{check.isChecked && check.columnValue}</td>
                      <td>{check.isChecked && check.description}</td>
                      <td>{check.isChecked && check.columnValue}</td>
                      <td>
                        {check.isChecked && (
                          <a href="url" data-toggle="modal" data-target="#flip">
                            f(x)
                          </a>
                        )}
                      </td>

                      <Preview />
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>

            <button
              type="button"
              class="transPop"
              data-toggle="modal"
              data-target="#flipFlop"
            >
              Summary f(x)
            </button>
            <GroupTransformation />

            {/* <Link className="pop" to="/saveTransaction" id="buttonAlignOne">
              Preview
            </Link> */}
            <Link
                  className="pop" id="buttonAlignOne"
                  to={{
                    pathname: "/saveTransaction",
                    aboutProps: {
                      name: { x }
                    }
                  }}
                >
                  Preview
                </Link>
          </div>
        </div>
      </div>
    </div>
  );
  //    }
}

export default Example;
